import * as S from "./styles";

function ListDetail({ attendant = {} }) {
  const { fullName, username, password, event } = attendant;
  return (
    <S.Container>
      <S.Fullname>{fullName}</S.Fullname>
      <S.Username>{username}</S.Username>
      <S.Password>{password}</S.Password>
      <S.Event>{event}</S.Event>
      <S.Delete></S.Delete>
    </S.Container>
  );
}

export default ListDetail;
